script: |
  super -f text -I q9333.spq | sort > q9333.out

inputs:
  - name: q9333.spq
    data: |
      SELECT + 42 AS col1, col2 + + col2 + - + ( + col2 ) FROM tab0 (FORMAT parquet) WHERE - - col0 * col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q9333.out
    data: |
      42	10
      42	47
      42	99
